import React, { Component } from 'react';
import { withRouter } from 'react-router-dom'

class HeaderComponent extends Component {
    constructor(props) {
        super(props);
        this.props = props;

        this.state = {

        }
    }
    allTickets(){
        this.props.history.push("/getAllTickets")
    }

    createTicket(){
        this.props.history.push('/addTicket');
    }
    render() {
        return (
            <div>
                <header>
                    <nav className="navbar navbar-expand-md navbar-dark bg-dark">
                        <div className = "row">
                            <button className= "btn btn-primary" onClick={this.allTickets()}>Create Ticket</button>
                            <button className= "btn btn-primary" onClick={this.createTicket()}>Create Ticket</button>
                        </div>
                    </nav>
                </header>
            </div>
        );
    }
}

export default withRouter(HeaderComponent);
